import axios from 'axios';


interface SignUpInfo {
    emailAddress: string;
    userPassword: string;
    fullName: string;
    university: number;
    course: string;
    yearOfStudy: number;
}


function signUp (values: SignUpInfo) {
    console.log("Service received");
    console.log(values)
    axios({
        method: 'post',
        url: '/user',
        baseURL: 'http://localhost:8080/api',
        data : {
            email : values.emailAddress,

        }
    }).then(function(response) {
        console.log(response);
    }).catch(function(error) {
        console.log(error);
    })
}

export default {
    signUp
}
